import React, { Component } from 'react';

class Like extends Component {
    render() {
        console.log(this.props)
        const {prop} = this.props;
        return ( 
            <i className={prop.like ? "fa fa-heart" : "fa fa-heart-o"} onClick={prop.onLike(prop.movie)} aria-hidden="true" />
         );
    }
}
 
export default Like;
